import React from 'react';
import {BrowserRouter as Router, Route, Redirect} from 'react-router-dom'
import User from './user/pages/User';
import NewPlace from './places/pages/NewPlace';

function App() {
  return (
  <Router>
    <Route path="/" exact>
      <User/>
    </Route>
    <Route path="/places/new" exact>
      <NewPlace/>
    </Route>
    <Redirect to="/" />
  </Router>
  )
}

export default App;
